import React from 'react';
import { BrowserRouter as Router,Routes, Route, Link } from 'react-router-dom';
import UploadPage from './pages/UploadPage';
import ImagesPage from './pages/ImagesPage';
import ImageViewer from './pages/ImageViewer';
import Nopage from './pages/Nopage'; 


function App() {
  return (
    <Router>
      <nav>
        <Link to ="/">Home</Link>
        <Link to ="/uploadImage">Uploaded Images</Link>
        <Link to ="/imagesviewer">Image Annotation Page</Link>

      </nav>
      <Routes>
        <Route path = "/" element = {<UploadPage/>}/>
        <Route path = "/uploadImage" element = {<ImagesPage/>}/>
        <Route path = "/imagesviewer" element = {<ImageViewer/>}/>
        <Route path = "*" element = {<Nopage/>}/>
      </Routes>
      <div>
        <a href="https://www.copyright.gov/what-is-copyright/#:~:text=Copyright%20is%20a%20type%20of,a%20tangible%20form%20of%20expression.">Copywrites</a>
      </div>
    </Router>
  );
}

export default App;


